import React from "react";

const Input = () => {
  return (
    <>
      <fieldset className="field">
        <label className="label" htmlFor={id}>{label}</label>
        <input
          className="input"
          id={id}
          type={type}
          name={name}
          placeholder={placeholder}
          disabled={disabled}
          required={required}
          onChange={onChange}
          value={value} 
        />
      </fieldset>
    </>
  );
};

export default Input;
